port: 7890
socks-port: 7891
mixed-port: 7890
allow-lan: false
interface-name: en0
mode: rule
log-level: info
external-controller: 127.0.0.1:9090
secret: ""

experimental:
  ignore-resolve-fail: true

profile:
  store-selected: false
  store-fake-ip: true

tcp-concurrent: true
enable-process: true
find-process-mode: strict
global-client-fingerprint: chrome
geodata-mode: true
geox-url:
  geoip: "https://cdn.jsdelivr.net/gh/Loyalsoldier/v2ray-rules-dat@release/geoip.dat"
  geosite: "https://cdn.jsdelivr.net/gh/Loyalsoldier/v2ray-rules-dat@release/geosite.dat"
  mmdb: "https://cdn.jsdelivr.net/gh/Loyalsoldier/geoip@release/Country.mmdb"
                
dns:
  enable: true
  listen: 0.0.0.0:53
  ipv6: false
  prefer-h3: true
  enhanced-mode: fake-ip
  fake-ip-range: 198.18.0.1/16
  use-hosts: true
  fake-ip-filter:
    - "*.lan"
    - "*.local"
    - "localhost.ptlogin2.qq.com"

  default-nameserver:
    - 1.1.1.1
    - 9.9.9.9
    - 8.8.8.8

  nameserver:
    - tls://one.one.one.one
    - https://1.1.1.1/dns-query
    - https://9.9.9.9/dns-query
    - https://8.8.8.8/dns-query

  fallback:
    - tls://one.one.one.one
    - https://1.1.1.1/dns-query
    - https://9.9.9.9/dns-query
    - https://8.8.8.8/dns-query

  fallback-filter:
   geoip: false
   ipcidr:
    - 0.0.0.0/8
    - 10.0.0.0/8
    - 100.64.0.0/10
    - 127.0.0.0/8
    - 169.254.0.0/16
    - 172.16.0.0/12
    - 192.0.0.0/24
    - 192.0.2.0/24
    - 192.88.99.0/24
    - 192.168.0.0/16
    - 198.18.0.0/15
    - 198.51.100.0/24
    - 203.0.113.0/24
    - 224.0.0.0/3
    - 240.0.0.0/4
   domain:
    - +.google.com
    - +.facebook.com
    - +.youtube.com
    - +.githubusercontent.com
    - +.twitter.com
    - +.googleapis.com
    - +.bing.com

tun:
  enable: true
  stack: system
  dns-hijack:
    - "any:53"
  auto-detect-interface: true
  auto-route: true
  auto-redir: true
  mtu: 9000
  strict_route: true

sniffer:
  enable: true
  sniff:
    TLS:
      ports: [443, 8443]
    HTTP:
      ports: [80, 8080-8880]
      override-destination: true
  skip-domain:
  - "*"

